import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import TextType from "./TextType"; // adjust path if needed




const Home = () => {

  const [nickname, setNickname] = useState("");
  const [comment, setComment] = useState("");
  const [comments, setComments] = useState([]);
  const [page, setPage] = useState(1);

  const commentsPerPage = 10;

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!nickname.trim() || !comment.trim()) return;

    // Add new comment on top
    setComments([{ nickname, text: comment }, ...comments]);
    setNickname("");
    setComment("");
  };

  const startIndex = (page - 1) * commentsPerPage;
  const currentComments = comments.slice(
    startIndex,
    startIndex + commentsPerPage
  );
  const totalPages = Math.ceil(comments.length / commentsPerPage);

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div
      className="relative bg-cover bg-center min-h-screen"
      style={{ 
        backgroundImage: "url('/bgpic.png')",
        backgroundSize: '100%, 100%',
        backgroundPosition: 'center',
      }}
    >
      {/* Hero Section */}
      
      <section className="relative py-20 px-4 sm:px-6 lg:px-8" >
        <div className="max-w-2xl mx-auto text-center">
        <h1 className="text-4xl md:text-6xl font-bold text-gray-900 mb-6">
          <TextType
            text={[
              "This is our story," , ""
            ]}
            as="h1"
            typingSpeed={30}
            pauseDuration={1000}
            deletingSpeed={30}
            loop={true}
            showCursor={true}
            textColors={["#000000", "transparent"]}
            cursorCharacter="|"
          />
          <br />
            <span className="text-transparent bg-clip-text bg-gradient-to-r from-[#BB6653] to-[#F08B51]">
              Beevengers
            </span>
        </h1>
          <p className="text-xl text-gray-600 mb-8 max-w-3xl mx-auto">
            This is a website made for STEMB 2024-26.
          </p>
        </div>
      </section>

      

      {/* About Section */}
      <section id="about" className="py-16 px-4 sm:px-6 lg:px-8 bg-[#DEE8CE]">
        <div className="max-w-4xl mx-auto text-center">
          <h2 className="text-3xl font-bold text-gray-900 mb-8">About Cultural Heritage</h2>
          <p className="text-lg text-gray-600 mb-8">
            Cultural heritage encompasses the traditions, customs, beliefs, and artifacts that are passed down from generation to generation. 
            It includes everything from language and religion to music, art, and cuisine. Understanding different cultures helps us appreciate 
            the diversity of human experience and fosters mutual respect and understanding.
          </p>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mt-12">
            <div className="text-center">
              <i className="fas fa-heart text-3xl text-[#BB6653] mb-4"></i>
              <h3 className="text-xl font-semibold text-gray-900 mb-2">Respect</h3>
              <p className="text-gray-600">Honoring the traditions and values of different cultures</p>
            </div>
            <div className="text-center">
              <i className="fas fa-lightbulb text-3xl text-[#F08B51] mb-4"></i>
              <h3 className="text-xl font-semibold text-gray-900 mb-2">Learning</h3>
              <p className="text-gray-600">Gaining knowledge and understanding of diverse perspectives</p>
            </div>
            <div className="text-center">
              <i className="fas fa-hands-helping text-3xl text-[#BB6653] mb-4"></i>
              <h3 className="text-xl font-semibold text-gray-900 mb-2">Connection</h3>
              <p className="text-gray-600">Building bridges between different communities and cultures</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
